window.bookSummaryJSON = "<p><b>They claimed my heat. I claimed their hearts.</b></p> <p>In a world where Omegas are cherished, Alphas are revered, and Betas are forgotten I wouldn't have changed a thing.</p> <p>Growing up in foster care, my friends and I took care of each other. Ares, Killian, Rafe, and Nox, were my everything: my first loves, my only family, my pack.</p> <p>Until the same night they told me we'd be together forever, I presented as an Omega, and everything changed.</p> <p>They betrayed me and turned me over to The Institute where Omegas are auctioned off to the highest bidder. I thought I'd never see them again . . . But four years later, they came back for me.</p> <p><b>Four alphas. One omega. A pack bond that couldn't be broken.</b></p> <p>Contains mature themes.</p>"; 
